import React, { Component } from 'react';
import './App.css';
import MyCard from './components/MyCard'



class App  extends Component {

  state = {
    "titre" : "Mon catalogue voiture"
  }
  render(){

    return (
      <div className="App">
        <MyCard titre ={this}/>
      </div>
    );

  }
}

export default App;
